import { Component } from "@angular/core";

import { CommonModule } from "@angular/common";

@Component({
  selector: "my-component, MyComponent",
  template: `
    <header class="main-container">
      <nav aria-label="Main Navigation">
        <a href="#" class="link">
          <img
            loading="lazy"
            src="https://cdn.builder.io/api/v1/image/assets/TEMP/3ec20a2053942c94f52f32355930656e3a5360147fc4560170ccde0e36f4ed28?apiKey=14a33fd9a33245f09b1bd9ed8f796835&"
            class="img"
            alt="Logo Image"
          />
          <span class="main-title">AdsTrees</span>
        </a>
        <div class="menu">
          <a href="#" class="link">
            <img
              loading="lazy"
              src="https://cdn.builder.io/api/v1/image/assets/TEMP/246fa02aaebe38276395e3ba2839e5642ec57f7bdb118b412c7d18dee08bc77a?apiKey=14a33fd9a33245f09b1bd9ed8f796835&"
              class="img"
              alt="Dashboard Icon"
            />
            <span class="menu-option">Dashboard</span>
          </a>
          <a href="#" class="link">
            <img
              loading="lazy"
              src="https://cdn.builder.io/api/v1/image/assets/TEMP/a2325af561ad2b42e14bccb562538789103ad6651782eec527d6cb1f19a7234b?apiKey=14a33fd9a33245f09b1bd9ed8f796835&"
              class="img"
              alt="Profile Icon"
            />
            <span class="menu-option">Profile</span>
          </a>
        </div>
      </nav>
    </header>
  `,
  styles: [
    `
      .main-container {
        align-content: center;
        align-self: stretch;
        flex-wrap: wrap;
        background-color: var(--whitePure, #081c15);
        display: flex;
        justify-content: space-between;
        gap: 20px;
        padding: 8px 16px;
      }

      .link {
        display: flex;
        justify-content: space-between;
        gap: 8px;
        padding: 10px;
        text-decoration: none;
        color: var(--greenDark, #e8f5f1);
      }

      .img {
        aspect-ratio: 1;
        object-fit: contain;
        object-position: center;
        width: 48px;
        overflow: hidden;
        max-width: 100%;
      }

      .main-title {
        white-space: nowrap;
        margin: auto 0;
        font: 400 24px Montserrat, sans-serif;
      }

      @media (max-width: 991px) {
        .main-title {
          white-space: initial;
        }
      }

      .menu {
        display: flex;
        gap: 16px;
        margin: auto 0;
      }

      .menu-option {
        justify-content: space-between;
        align-items: center;
        border-radius: 21px;
        border: 1px solid var(--greenDark, #e8f5f1);
        background-color: var(--whitePure, #081c15);
        display: flex;
        gap: 4px;
        padding: 6px 7px;
        font: 500 14px Poppins, sans-serif;
      }

      .menu-option img {
        aspect-ratio: 1;
        object-fit: contain;
        object-position: center;
        width: 16px;
        fill: var(--greenDark, #e8f5f1);
        overflow: hidden;
        max-width: 100%;
        margin: auto 0;
      }

      @media (max-width: 991px) {
        .menu-option {
          white-space: initial;
        }
      }

      .menu-option:last-child {
        border-color: var(--greyLight, rgba(168, 177, 174, 0.1));
        color: var(--greyDark, #f1f0f3);
      }
    `,
  ],
})
export class MyComponent {}
